    "full_text" : "In the series of forgotten operating systems:\nSITS - \"Small Incompatible Timesharing System\"\n\nIf you think the regular ITS is too common and mainstream, this may be for you.  It only ever ran on one computer: the MIT Logo group PDP-11/45.",
