    "favorited" : false,
    "full_text" : "@adventofcomp We reimagined the 7-bit field to be year minus 1900 and updated programs to display a four-digit year.  This would leave us with a Y2028 problem, but as luck would have it there are one or two spare bits.  We can expand to 8 bits to go to year 2155.",
