    "full_text" : "@adventofcomp ITS had some Y2K problems.  The system calls and file system timestamps use a 7-bit field to store the year.  It was expected to hold two decimal digits: the year modulo 100.  When this wrapped over from 99 to 100 many programs were confused.",
