    "in_reply_to_status_id" : "1346786044834930688",
    "created_at" : "Thu Jan 07 07:37:09 +0000 2021",
    "favorited" : false,
    "full_text" : "I'm not sure which is the correct answer. The first moby memory, and perhaps The Moby, was 256K of 40-bit words. But maybe this point is moot since only ever 36 bits were actually used. There were discussions about using the spare bits for Lisp tag bits, but that never happened.",
